import React, { Component } from "react";
import Card from "react-bootstrap/Card";
import "../styles/photographersSelection.css";
import p2 from "../assets/p2.jpg";
import CardGroup from "react-bootstrap/CardGroup";
import CardDeck from "react-bootstrap/CardDeck";

class PhotographersCard extends Component {
  constructor(props) {
    // constructor
    super(props);
    this.state = {
      Name: this.props.Name,
      Level: this.props.Level,
    };
  }
  render() {
    return (
      <Card className="cardStyle">
        <Card.Img variant="top" src={p2} />
        <Card.Body>
          <Card.Title>{this.state.Name}</Card.Title>
          <Card.Text>
            <ul>{this.state.Level}</ul>
            Location <br></br>
            {}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
          <a
            className="btn btn-primary text-center mr-2 mt-5 "
            href={"#"} //passing the value of category to the link
          >
            View
          </a>
        </Card.Footer>
      </Card>
    );
  }
}

export default PhotographersCard;
